//Show statistical data
const showStatisticalData = function() {
   const newEdfForInterval = newEdfArray.join('');
   const intervals = [];
   let maxInterval = 0;
   let firstValue = 0;
   let lastIndex = 0;
   for (let i = 0, previousValue = 0; i < newEdfForInterval.length / 4; i++) {
      const currentValue = parseInt(`0x${newEdfForInterval.slice(4 * i, 4 * i + 4)}`);
      if (i > 0) {
         const interval = currentValue - previousValue;
         if (maxInterval < Math.abs(interval)) {
            maxInterval = interval;
         }
         intervals.push(interval);
      } else {
         firstValue = currentValue;
      }
      lastIndex = i;
      previousValue = currentValue;
   }
   console.log(`intervals: ${intervals}`);
   console.log(`first value: ${firstValue}  lastIndex: ${lastIndex} max interval: ${maxInterval}`);
};

